import React from "react";

const Top=(props)=>{
    const {top}=props;

    const url="http://image.tmdb.org/t/p/w185";
    return(
        <>
        <div><h4>Top Rated Movies</h4></div>
           {
               top.map((topmovie)=>(
                <div className="center-box">
                <img src={url + topmovie.poster_path} alt="top"/>
            </div> 
               ))
           }

        </>
    );
}
export default Top;
